import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Button, 
  Grid, 
  Card, 
  CardContent,
  useTheme,
  IconButton 
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const scrollToFeatures = () => {
    const featuresSection = document.getElementById('features');
    featuresSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <Box sx={{ minHeight: '100vh' }}>
      {/* Full Screen Hero Section */}
      <Box
        sx={{
          position: 'relative',
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          bgcolor: 'background.default',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'radial-gradient(circle at top right, rgba(220, 20, 60, 0.15), transparent 50%)',
            zIndex: 1,
          }
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 2 }}>
          <Grid container spacing={4} alignItems="center">
            <Grid item xs={12} md={7}>
              <Box sx={{ 
                textAlign: { xs: 'center', md: 'left' },
                mt: { xs: -8, md: -4 }
              }}>
                <Typography
                  variant="h1"
                  sx={{
                    fontSize: { xs: '2.5rem', md: '3.5rem', lg: '4rem' },
                    mb: 2,
                    background: 'linear-gradient(to right, #FFFFFF, #DC143C)',
                    WebkitBackgroundClip: 'text',
                    WebkitTextFillColor: 'transparent',
                    fontWeight: 700,
                  }}
                >
                  Master Your Time
                </Typography>
                <Typography
                  variant="h2"
                  sx={{
                    fontSize: { xs: '1.5rem', md: '2rem' },
                    mb: 4,
                    color: 'text.secondary',
                    fontWeight: 500,
                  }}
                >
                  AI-Powered Study Schedule Optimization
                </Typography>
                <Box sx={{ 
                  display: 'flex', 
                  gap: 2,
                  justifyContent: { xs: 'center', md: 'flex-start' }
                }}>
                  <Button
                    variant="contained"
                    size="large"
                    onClick={() => navigate('/register')}
                    sx={{
                      py: 2,
                      px: 4,
                      fontSize: '1.1rem',
                    }}
                  >
                    Get Started
                  </Button>
                  <Button
                    variant="outlined"
                    size="large"
                    onClick={() => navigate('/login')}
                    sx={{
                      py: 2,
                      px: 4,
                      fontSize: '1.1rem',
                      borderWidth: '2px',
                    }}
                  >
                    Login
                  </Button>
                </Box>
              </Box>
            </Grid>
          </Grid>
        </Container>
        {/* Scroll Down Indicator */}
        <Box
          sx={{
            position: 'absolute',
            bottom: 40,
            left: '50%',
            transform: 'translateX(-50%)',
            zIndex: 2,
            textAlign: 'center',
            cursor: 'pointer',
          }}
          onClick={scrollToFeatures}
        >
          <Typography
            variant="body2"
            sx={{
              color: 'text.secondary',
              mb: 1,
              fontSize: '0.9rem',
              textTransform: 'uppercase',
              letterSpacing: '0.1em',
            }}
          >
            Scroll Down
          </Typography>
          <IconButton
            sx={{
              color: theme.palette.primary.main,
              animation: 'bounce 2s infinite',
              '@keyframes bounce': {
                '0%, 20%, 50%, 80%, 100%': {
                  transform: 'translateY(0)',
                },
                '40%': {
                  transform: 'translateY(-10px)',
                },
                '60%': {
                  transform: 'translateY(-5px)',
                },
              },
            }}
          >
            <KeyboardArrowDownIcon />
          </IconButton>
        </Box>
      </Box>

      {/* Features Section */}
      <Box sx={{ py: { xs: 12, md: 20 } }}>
        <Container maxWidth="lg">
          <Grid container spacing={10}>
            {[
              {
                icon: <AccessTimeIcon sx={{ fontSize: 48, color: '#DC143C' }} />,
                title: "Smart Scheduling",
                description: "AI-powered scheduling that adapts to your study habits and preferences.",
              },
              {
                icon: <AutoGraphIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
                title: "Performance Analytics",
                description: "Track your progress and optimize your study efficiency with real-time insights."
              },
              {
                icon: <CalendarMonthIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
                title: "Seamless Planning",
                description: "Effortlessly manage your academic schedule with our intuitive interface."
              }
            ].map((feature, index) => (
              <Grid item xs={12} md={4} key={index}>
                <motion.div
                  initial={{ opacity: 0, y: 30 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.7, delay: index * 0.3 }}
                  viewport={{ once: true }}
                >
                  <Box
                    sx={{
                      p: 8,
                      height: '100%',
                      background: 'rgba(255, 255, 255, 0.02)',
                      borderRadius: '40px',
                      border: '1px solid rgba(255, 255, 255, 0.05)',
                      transition: 'all 0.5s ease',
                      position: 'relative',
                      overflow: 'hidden',
                      '&::before': {
                        content: '""',
                        position: 'absolute',
                        top: 0,
                        left: 0,
                        right: 0,
                        bottom: 0,
                        background: 'radial-gradient(circle at top right, rgba(220, 20, 60, 0.15), transparent 70%)',
                        opacity: 0,
                        transition: 'opacity 0.5s ease',
                      },
                      '&:hover': {
                        transform: 'translateY(-16px)',
                        background: 'rgba(255, 255, 255, 0.03)',
                        borderColor: 'rgba(220, 20, 60, 0.3)',
                        boxShadow: '0 30px 60px rgba(0, 0, 0, 0.5)',
                        '&::before': {
                          opacity: 1,
                        }
                      },
                    }}
                  >
                    <Box
                      sx={{
                        display: 'inline-flex',
                        p: 4,
                        borderRadius: '25px',
                        background: 'rgba(220, 20, 60, 0.1)',
                        mb: 5,
                        transform: 'rotate(-5deg)',
                        transition: 'transform 0.3s ease',
                        '&:hover': {
                          transform: 'rotate(0deg) scale(1.1)',
                        }
                      }}
                    >
                      {React.cloneElement(feature.icon, { 
                        sx: { fontSize: 64, color: '#DC143C' }
                      })}
                    </Box>
                    <Typography
                      variant="h3"
                      sx={{
                        mb: 4,
                        color: '#fff',
                        fontWeight: 700,
                        fontSize: { xs: '2rem', md: '2.5rem' },
                        letterSpacing: '-0.02em',
                      }}
                    >
                      {feature.title}
                    </Typography>
                    <Typography
                      sx={{
                        color: 'rgba(255, 255, 255, 0.8)',
                        lineHeight: 1.8,
                        fontSize: '1.2rem',
                        letterSpacing: '0.01em',
                      }}
                    >
                      {feature.description}
                    </Typography>
                  </Box>
                </motion.div>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>

      {/* Call to Action Section */}
      <Box
        sx={{
          py: { xs: 8, md: 12 },
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'radial-gradient(circle at bottom left, rgba(220, 20, 60, 0.15), transparent 50%)',
            zIndex: 1,
          }
        }}
      >
        <Container maxWidth="md" sx={{ position: 'relative', zIndex: 2 }}>
          <Box sx={{ textAlign: 'center' }}>
            <Typography
              variant="h3"
              sx={{
                mb: 3,
                fontSize: { xs: '2rem', md: '2.5rem' },
                fontWeight: 600,
              }}
            >
              Ready to Transform Your Study Routine?
            </Typography>
            <Typography
              variant="h6"
              sx={{
                mb: 4,
                color: 'text.secondary',
                fontSize: { xs: '1.1rem', md: '1.25rem' },
                fontWeight: 400,
                lineHeight: 1.6,
              }}
            >
              Join thousands of students who are maximizing their potential with Tempo.
            </Typography>
            <Button
              variant="contained"
              size="large"
              onClick={() => navigate('/register')}
              sx={{
                py: 2,
                px: 6,
                fontSize: '1.1rem',
              }}
            >
              Get Started Now
            </Button>
          </Box>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
